import './App.css';

function Header() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Fish Tank Tracker
        </p>
        <ul>
            <li> Home </li>
            <li> Fish Tracker </li>
            <li> Tank Cleaning Tracker </li>
        </ul>
      </header>
    </div>
  );
}

export default Header;
